import { Rect, Defs, Pattern, Use, SvgXml } from 'react-native-svg'
import { Icon } from 'native-base'
import { memo, useEffect, useState } from 'react'

const getImage = () =>
  window.atob(
    `data:image/png;base64,`
  )

const Logo = memo(() => {
  const [src, setSrc] = useState('')

  useEffect(() => {
    setSrc(getImage())
  }, [])

  return (
    <Icon width="85" height="84" viewBox="0 0 85 84" bg="transparent">
      <Rect width="85" height="84" fill="url(#pattern0)" />
      <Defs>
        <Pattern
          id="pattern0"
          patternContentUnits="objectBoundingBox"
          width="1"
          height="1"
        >
          <Use
            xlinkHref="#image0_489_997"
            transform="translate(-0.00343086) scale(0.000517401)"
          />
        </Pattern>
        <SvgXml id="image0_489_997" width="1946" height="1910" xml={src} />
      </Defs>
    </Icon>
  )
})

export default Logo
